Description
. 
Female
(KS.108712): Prosoma predominantly reddish-brown with a small median spire on the cephalic portion (
Fig. 32B
), covered by many whitish setae on the posterior slope and sides of cephalic area (
Fig. 32A
); anterior eye row recurved and posterior straight; cephalic and ocular projections discrete (
Fig. 32B
). Legs dark-yellow with brown tinges on the distal portion of femora, patellae and tibiae. These same leg segments bear acute projections with a terminal macrosetae and covered by smaller hyaline ones (
Fig. 32A
). Opisthosoma trapezoid, predominantly light-yellow with brownish anterolateral spots. Epigynum with segmented spermathecae, glandular-heads with many perforations and anterior chambers reduced (
Fig. 32D
).

Male
(AMS KS.108716): Prosoma and legs predominantly burgundy colored (
Fig. 33A
); eye arrangement as in female. Anterior metatarsi and tarsi (I and II) light-brown; whitish setae clustered on the median region of the posterior slope of prosoma and on the sides of cephalic area, occurring also on the lateral margin of the clypeus and between the ALE and AME (
Fig. 33B
). Opisthosoma trapezoid and dark-yellow with lateral and posterior darker spots. Palpi short with Pcym rounded and RTAvbr truncated (
Fig. 33C,D
).
